function decimalToBinary(num) {
  const stack = [];
  
  while (num > 0) {
    stack.push(num % 2);
    num = Math.floor(num / 2);
  }
  
  let binary = '';
  while (stack.length > 0) {
    binary += stack.pop();
  }
  
  return binary;
}

